import { FaBars, FaTimes } from "react-icons/fa";

function navBar() {
	return (
		<header>
			<h3> Home</h3>
			<nav>
				<a href="/#">Home</a>
				<a href="/#">Levels</a>
				<a href="/#">FAQ</a>
				<a href="/#">Report</a>
				<button>
					<FaTimes />
				</button>
			</nav>
			<button>
				<FaBars />
			</button>
		</header>
	);
}

export default navBar;
